import styled from 'styled-components';

const PriceTag = styled.span`
  background: rgb(var(--cream));
  color: rgb(var(--turquoise));
  padding: 5px;
  line-height: 1;
  font-size: 1.5rem;
  display: inline-block;
  position: absolute;
  top: 160px;
  right: -5px;

  &::after {
    content: ' ';
    display: block;
    width: 20px;
    height: 100%;
    back
  }
`;

export default PriceTag;
